"use strict";(self.webpackChunk_manekiswap_document=self.webpackChunk_manekiswap_document||[]).push([[8942],{249:function(e){e.exports=JSON.parse('{"name":"api","permalink":"/tags/api","docs":[{"id":"reference/API/01-overview","title":"API Overview","description":"This section explains the Uniswap Subgraph and how to interact with it. The Uniswap subgraph indexes data from the Uniswap contracts over time. It organizes data about pairs, tokens, Uniswap as a whole, and more. The subgraph updates any time a transaction is made on Uniswap. The subgraph runs on The Graph protocol\'s hosted service and can be openly queried.","permalink":"/reference/"},{"id":"reference/API/02-entities","title":"Entities","description":"Entities define the schema of the subgraph, and represent the data that can be queried. Within each entity are sets of fields that store useful information related to the entity. Below is a list of the available entities within the Uniswap Subgraph, and descriptions for the available fields.","permalink":"/reference/API/02-entities"},{"id":"reference/API/03-queries","title":"Queries","description":"The subgraph can be queried to retrieve important information about Uniswap, pairs, tokens, transactions, users, and more. This page will provide examples for common queries.","permalink":"/reference/API/03-queries"}],"allTagsPath":"/tags"}')}}]);